import React, { Component } from 'react'
import ClientItem from './Client/ClientItem';

class Dashboard extends Component {
    render() {
        return (
            <div>
            <h1>Welcome to dashboard</h1>
            <ClientItem />
            </div>
        );
    }
}

export default Dashboard;
